//import React from 'react'
import React, { useState, useEffect } from "react";

const useFilter = (url) => {
    const [todos, setTodos] = useState([]);
   
    useEffect(() => {
      const fetchTodos = async () => {
        const res = await fetch(url);
        const data = await res.json();
        setTodos(data);
        //console.log(data);
      };
      fetchTodos();
    }, [url]);

  return [todos]
}

export default useFilter;
